        private void ToLacePreview(Tie lace)
        {
            Application.Current.MainPage.Navigation.PushAsync(new LacePreviewView(lace));
        }

        private async Task RefreshData(EventArgs e)
        {
            await Task.Delay(10);

            using (var context = new TiesContext())
            {
                var laces = context.Laces.ToList();
                Laces = new ObservableCollection<Tie>(laces);
            }
        }

        private async Task AddLace(EventArgs e)
        {
            var lace = new Tie { Name = $"Laço {new Random().Next(10, 100)}" };
            using (var context = new TiesContext())
            {
                await context.Laces.AddAsync(lace);

                await context.SaveChangesAsync();
            }

            Laces.Add(lace);
        }

        private async Task DeleteLace(Tie lace)
        {
            using(var context = new TiesContext())
            {
                context.Laces.Remove(lace);
                await context.SaveChangesAsync();
            }

            Laces.Remove(lace);
        }
    }
